sys_ux_client_script.script:
/**
  * @param {params} params
  * @param {api} params.api
  * @param {TransformApiHelpers} params.helpers
  */
function evaluateProperty({api, helpers}) {

  if (api.state.TasksStates.Scheduled.active) {
    console.log("From Filter => Scheduled");
    return 'state='+api.state.TasksStates.Scheduled.active;
  }else{
    console.log("From Filter => Empty");
    return'';
  }

}
